//#region MP4

class MP4Header {
	constructor(bytes, mimeType, codec, width, height) {
		this.timescale = 0;
		this.duration = 0;
		this.cues = [];

		this.mimeType = mimeType;
		this.codec = codec;
		this.width = width;
		this.height = height;
		this.samplingFrequency = 48000;

		let pointer = {index: 0};
		
		function readBoxHeader(pointer) {
			const size = binaryReadUInt(bytes, pointer, 4) - 8;
			const type = String.fromCharCode(...binaryReadBytes(bytes, pointer, 4));
			return [type, size];
		}

		let mp4Duration = -1;
		let mp4DurationInCueTimescale = -1;
		let mp4DurationTimescale = -1;
		let mp4CueTimescale = -1;

		
		let foundTypes = [];
		while(pointer.index < bytes.length) {
			const [type, size] = readBoxHeader(pointer);
			const startOffset = pointer.index;
			foundTypes.push(type + ": " + size);

			switch(type) {
				case "moov":
					while(pointer.index - startOffset < size && pointer.index < bytes.length) {
						const [moovType, moovSize] = readBoxHeader(pointer);
						switch(moovType) {
							case "mvhd":
								const mvhdStartOffset = pointer.index;
								const version = binaryReadByte(bytes, pointer);
								const flags = binaryReadBytes(bytes, pointer, 3);
								if(version == 1) {
									const creationTime = binaryReadUInt(bytes, pointer, 8);
									const modifyTime = binaryReadUInt(bytes, pointer, 8);
								}
								else {
									const creationTime = binaryReadUInt(bytes, pointer, 4);
									const modifyTime = binaryReadUInt(bytes, pointer, 4);
								}
								mp4DurationTimescale = binaryReadUInt(bytes, pointer, 4);
								if(version == 1)
									mp4Duration = binaryReadUInt(bytes, pointer, 8);
								else
									mp4Duration = binaryReadUInt(bytes, pointer, 4);
								pointer.index = mvhdStartOffset + moovSize;
							break;
							default:
								pointer.index += moovSize;
							break;
						}
					}
					if(pointer.index > startOffset + size) {
						throw new ScriptException("Invalid amount of bytes read from moov section.");
					}
				break;
				case "sidx": 
					this.indexRangeStart = startOffset;
					this.indexRangeEnd = startOffset + size;
					const version = binaryReadByte(bytes, pointer);
					const flags = binaryReadBytes(bytes, pointer, 3);
					const referenceID = binaryReadUInt(bytes, pointer, 4);
					mp4CueTimescale = binaryReadUInt(bytes, pointer, 4);
					mp4DurationInCueTimescale = parseInt((mp4Duration / mp4DurationTimescale) * mp4CueTimescale);
					
					let earliestPresentationTime = -1;
					if(version == 0) {
						earliestPresentationTime = binaryReadUInt(bytes, pointer, 4);
						let firstOffset = binaryReadUInt(bytes, pointer, 4);
					}
					else {
						earliestPresentationTime = binaryReadUInt(bytes, pointer, 8);
						let firstOffset = binaryReadUInt(bytes, pointer, 8);
					}

					binaryReadUInt(bytes, pointer, 2);
					const referenceCount = binaryReadUInt(bytes, pointer, 2);

					let currentPresentationTime = earliestPresentationTime;
					this.cues.push(currentPresentationTime);
					for(let i = 0; i < referenceCount - 1; i++) {
						const referenceSize = binaryReadUInt(bytes, pointer, 4);
						const segmentDuration = binaryReadUInt(bytes, pointer, 4);
						const deltaTimeStartsWith = binaryReadUInt(bytes, pointer, 4);

						currentPresentationTime += segmentDuration;
						this.cues.push(currentPresentationTime);
					}

					binaryReadUInt(bytes, pointer, 4); //referenceSize
					const lastSegmentDuration = binaryReadUInt(bytes, pointer, 4);
					binaryReadUInt(bytes, pointer, 4);

					if(((this.cues[this.cues.length - 1] + lastSegmentDuration) - mp4DurationInCueTimescale) > 2)
						throw new ScriptException("Cue points not lining up.");
					
					if(pointer.index != startOffset + size)
						throw new ScriptException("Invalid amount of bytes read from sidx section.");
				break;
				default:
					pointer.index += size;
					break;
			}
		}
		console.log("MP4 Segments:", foundTypes);
		this.durationSeconds = mp4Duration / mp4DurationTimescale;
		this.durationCueTimescale = parseInt((mp4Duration / mp4DurationTimescale) * mp4CueTimescale);
		this.cueTimeScale = mp4CueTimescale;
		this.timescale = mp4CueTimescale * 1000;
		this.duration = parseInt((mp4Duration / mp4DurationTimescale) * 1000);
	}

}

//#endregion

//#region WEBM
class WEBMHeader {
	constructor(bytes, mimeType, codec, width, height) {
		this.timescale = 0;
		this.duration = 0;
		this.cues = [];

		this.mimeType = mimeType;
		this.codec = codec;
		this.width = width;
		this.height = height;
		this.samplingFrequency = 48000;

		let pointer = {index: 0};

		while(pointer.index < bytes.length) {
			const fieldId = binaryReadVariableUInt(bytes, pointer);
			const fieldSize = binaryReadVariableInt(bytes, pointer);

			switch(fieldId) {
				case 0x18538067: //Segment
					console.log("Found segment");
					const startOffset = pointer.index;
					while(pointer.index - startOffset < fieldSize && pointer.index < bytes.length) {
						const subFieldOffset = pointer.index;
						const subFieldId = binaryReadVariableUInt(bytes, pointer);
						const subFieldSize = binaryReadVariableInt(bytes, pointer);
		
						switch(subFieldId) {
							case 0x1549A966: //Info
								console.log("Found info in segment");
								let infoStartOffset = pointer.index;
								while(pointer.index - infoStartOffset < subFieldSize && pointer.index < bytes.length) {
									const infoFieldId = binaryReadVariableUInt(bytes, pointer);
									const infoFieldSize = binaryReadVariableInt(bytes, pointer);
		
									switch(infoFieldId) {
										case 0x2AD7B1:
											console.log("found timescale in info");
											this.timescale = binaryReadUInt(bytes, pointer, infoFieldSize);
											log("Timescale: " + this.timescale);
											break;
										case 0x4489:
											console.log("Found duration in info");
											this.duration = binaryReadFloat(bytes, pointer, infoFieldSize);
											break;
										default:
											pointer.index += infoFieldSize;
											break;
									}
								}
								if(pointer.index - infoStartOffset > subFieldSize)
									throw new ScriptException("Corrupt WEBM segment");
		
								break;
							case 0x1C53BB6B: //Cues
								console.log("Found Cues in segment");
								const cuesStartOffset = pointer.index;
								this.indexRangeStart = subFieldOffset;
								this.indexRangeEnd = cuesStartOffset + subFieldSize;
								while(pointer.index - cuesStartOffset < subFieldSize && pointer.index < bytes.length) {
									const cuesFieldId = binaryReadVariableUInt(bytes, pointer);
									if(cuesFieldId != 0xBB)
										throw new ScriptException("Expected cue point");
		
									const cuePointSize = binaryReadVariableInt(bytes, pointer);
									const cuePointStartOffset = pointer.index;
		
									let cueTime = -1;
									while(pointer.index - cuePointStartOffset < cuePointSize && pointer.index < bytes.length) {
										const cuePointFieldId = binaryReadVariableUInt(bytes, pointer);
										const cuePointFieldSize = binaryReadVariableInt(bytes, pointer);
										switch(cuePointFieldId) {
											case 0xB3:
												cueTime = binaryReadUInt(bytes, pointer, cuePointFieldSize);
												break;
											default:
												pointer.index += cuePointFieldSize;
												break;
										}
									}
		
									if(pointer.index - cuePointStartOffset > cuePointSize)
										throw new ScriptException("Corrupt cue point");
									if(cueTime < 0)
										throw new ScriptException("Expected cue time to be set.");
		
									this.cues.push(cueTime);
								}
								break;
							default:
								pointer.index += subFieldSize;
								break;
						}
					}
					if(pointer.index - startOffset > fieldSize)
						throw new ScriptException("Corrupt segment");
					break;
					default:
						pointer.index += fieldSize;
			}
		}
		this.durationSeconds = this.duration / (this.timescale / 1000);
		this.durationCueTimescale = this.duration;
		this.cueTimeScale = this.timescale / 1000;
	}
}


